import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className='app-wrapper'>
      <div className='header block'>Шапка сайта</div>
      <div className='navigation block'>Навигация сайта</div>
      <div className='photo block'>Ебанутая фотка</div>
      <div className='personalInfo block'>Еще более ебанутое описание</div>
      <div className='main block'>Стена</div>
      <div className='advertise '>Заработай денег</div>
      <div className='social'>Круг знакомств</div>
      <div className='footer'>Подвал</div>
    </div>
  );
}

export default App;
